(311, 191, 38, 'Hello!\r\n\r\nI see that you have listed your bag in the "General" section of the site. We recently created a "Clothing & Bags" section, and if you added your item to that category, I would imagine it would bring even more traffic to your listing!\r\n\r\nAlso, how are you finding your experience here so far? Is everything going okay? Feel free to ask me any questions!', '2013-05-01 00:09:50', '2013-05-01 00:09:50'),
(321, 201, 1421, 'http://theboxngo.com/shops/viewlisting/1971', '2013-05-02 14:53:43', '2013-05-02 14:53:43'),
(331, 211, 1911, 'I am trying to purchase your earrings with my debit card but it won''t go through because I don''t have a coupon code.  Can you explain to me what that means?  I am new to the site and I would love your earrings!!  Thanks', '2013-05-04 08:37:06', '2013-05-04 08:37:06'),
(341, 211, 871, 'Hi, I do not think you should have a coupon code to purchase an item. I will message Boxngo and find out and get back to you on this. Thank you, Delores', '2013-05-04 11:17:50', '2013-05-04 11:17:50'),
(351, 121, 871, 'Hi, Dianons,  I have my first order trying to pay for her item and she and I are both new here on BOX''NGO, Here is her message to me .....\r\nI am trying to purchase your earrings with my debit card but it won''t go through because I don''t have a coupon code. Can you explain to me what that means? I am new to the site and I would love your earrings!! Thanks\r\n\r\nIf you can get back to me and let me know what to tell her how to pay for item. Waiting for your reply,\r\nDelores at sweettbambi505@aol.com', '2013-05-04 11:32:32', '2013-05-04 11:32:32'),
(361, 121, 34, 'Hey Delores,\r\n\r\nAll she has to do is basically fill out the details like first name / last name / shipping address and click on "Pay With Card". It''s a big blue button.', '2013-05-04 13:21:46', '2013-05-04 13:21:46'),
(371, 121, 34, 'Actually, scratch that. She was absolutely correct. It has been fixed.\r\n\r\nI''m terribly sorry about that.', '2013-05-04 13:38:16', '2013-05-04 13:38:16'),
(381, 211, 871, 'Hi, I found out what happen why it wouldn''t work out. I got ahold of the company and they have fixed it now. It should be fixed now. Try it again and let me know. Thank you so much for your interest, Delores..... sweettbambi505@aol.com', '2013-05-04 16:14:16', '2013-05-04 16:14:16'),
