(1901, 1, 1421, 'Bill Elliott and Mc Donalds  Grads & DADS ', 'I have references also, from Yardsellr.com. Everyone I have sold to has been pleased with the items they have purchased. Let me know and I would send you names and phone numbers. \r\n\r\nI have a collection of Bill Elliott  ranging from the early 90''s through to 2002-2003 season.\r\n\r\nI aquired this colllection from my brother. He was in jail for a while, and when I moved from the area I brought his things with me. He is in CA now, and I am in FL. \r\n\r\nWith the ups and downs in the family trying to help him, he didnt waste too much time before he told me to sell it all. I know he had a rough time deciding because he really did love this collection. I have had it 8 years, and I have inventoried it, and had it appraised item by item. \r\n\r\nI almost know it by heart. Bill Elliot has 2 118sc; 3 124sc; and a whole assostment of 164sc. There is an unassembled Model. It came to over $635.00 last yr when it was priced out. 2 tubs full.\r\nThe 118sc are by Ertl and Authentics. the 124sc are RC.\r\n I am comfortable selling it as one lot for $600.00 Delivered. There are other pictures, so please keep looking. F.Y.I. I also have 11 years of the races, edited, I believe (no commercials). Anyone who would like those is welcome to inquire here. Insurance is $50.00', 1, '575.00', '2013-04-30 17:01:05', '2013-06-02 22:14:52', '0.00', '', 71, 'bill-elliott-and-mc-donalds-grads-dads'),
(1911, 0, 1421, 'Dick May', 'This is a car from the 50th Anniv   \r\n\r\nIssue #42\r\n\r\nseveral of these scattered throught the collection, \r\n\r\nyou can see it is from the 50th Anniversary "NASCAR LEGENDS Commemerative Edition".  164sc   #57 Bowani Ford Galaxy.\r\n\r\n Purchase all of the  "NASCAR LEGENDS Commemerative Edition" car (6) I think for $  120.00 delivered. Wont exceed price here.', 1, '35.00', '2013-04-30 17:17:49', '2013-05-01 00:59:22', '0.00', '', 11, 'dick-may'),
