(1931, 0, 1421, 'Another shot at some Bill Elliott', '118sc "ERTL" Bill Elliott (top Left)\r\n\r\n124sc "GPC"        &    Monopoly  via Mc Donalds Advertisement\r\n\r\nThe Gpc car went up last year invalue about $20.00  Great Detail by RC\r\n\r\nCan be split, but I dont advise splitting a collection really, because you will miss out on the other really great Bill Elliott career.  $Delivered$ prices on Ellliot are on another slide\r\n', 1, '600.00', '2013-04-30 17:31:26', '2013-05-01 01:01:09', '0.00', '', 11, 'another-shot-at-some-bill-elliott'),
(1941, 1, 1421, ' Mayfield, Newman  Wallace  DADS & GRADS!!', 'Assorted Jeremy Mayfield  Mike & Rusty Wallace\r\n\r\nGreat colors, Penske, Kentucky Derby\r\n\r\nI beleive there  143sc and 124sc (might be a Hot Wheels)\r\n\r\nI have had many satisfied customers. \r\nSome of my boxes are beat up but the cars are fine. I will sell all of the Penske/ Mike Wallace  & Ryan Newman & Jeremy Mayfield for $ 130.00 delivered. Includes Shipping Insurance. Price locked UNTIL 6/16/2013...so, if you are liking what you see and the box doesnt matter, then these cars are for you! Build that collection you have always wanted! \r\n\r\nSome of these cars are just plain old & they have damage to the pkgs. I have tried to be fair and represent what you will get.( I am showing the damage some of these things have) ', 1, '135.00', '2013-04-30 17:41:36', '2013-06-02 22:19:06', '0.00', '', 71, 'mayfield-newman-wallace-dads-grads');
