(2001, 1, 1421, 'All Mc Donalds'' Bill Elliott/Yates/ Mcclenathan', 'Bottom Left is a bank. \r\nI promised to give you some decent shots of the Mc Donald/Elliott Years.\r\n\r\nPrice is one Fixed price   $ 575  Delivered, Until 6/16/13 midnite EDT.\r\n\r\nThe Transport appears in the Transports sets, so If you dont get it in this collection, you may not get it at all. FIRST COME...FIRST SERVE\r\n\r\nI know some will say that it isnt fair, but really it is collateral damage either way, and personally, after having this for my brother, nearly 9 years, I have held it for him. Anything I can sell cheap he will be elated, cause he needs tools. \r\n\r\nThis collection is within a stones throw of USPS; FED EX; UPS; and Greyhound Bus. Shipping can be arranged no matter what!  Only thing I request, if you place an order that you would please be fair and tell me if you are "a rural Address". The shipping goes up big time. Its more then a fair question. Thanks. ', 1, '575.00', '2013-05-01 01:36:43', '2013-06-02 23:44:56', '0.00', '', 71, 'all-mc-donalds-bill-elliott-yates-mcclenathan'),
