(6011, 1, 2281, 'Fine Art Work - "Bequest Levianthan" by Nicole Stahl', 'Stunning Ocean-life Artwork of Nicole Stahl.  Exquisitely detailed with a luminous quality, Stahl''s work is stunning addition to any collection.\r\n\r\n"Bequest Leviathan" is a seriolithograph on paper, PP numbered and hand-signed by the Artist.  Includes certificate of Authenticity [COA],  Measures approximately 16.5" x 21.5" [image], 18.5" X 23.5" [with Border].  List Price $595.00\r\n\r\nNicole Stahl started drawing and painting as a child, but it wasn''t until 1993 that she began to develop her forte as an artist creating large-scale paintings.  Since then, she has focused primarily on ocean life as subjects for her artwork.  Stahl became a certified diver and travels the world to study and gain deeper understanding of her artistic subjects.  Stahl''s paintings are known for their luminous quality and attention to detail, all depicted in vibrant color.\r\n\r\nPicture with be mailed in a Tube.', 1, '238.00', '2013-05-09 12:31:08', '2013-05-09 12:32:10', '17.95', '', 91, 'fine-art-work-bequest-levianthan-by-nicole-stahl'),
(6021, 1, 2281, 'Fine Art - "Mary Mother of Jesus"', 'Bruce Eagle! "Mary Mother of Jesus" LIMITED EDITION Giclee on Canvas, Numbered with Certificate of Authenticity!\r\n\r\nNOW IS YOUR CHANCE TO OWN THE EMOTIONAL ARTWORK OF BRUCE EAGLE! Blending iconic subjects with his own unique style, Bruce Eagle creates memorable works of art. "Mary Mother of Jesus" is a limited edition giclee on un-stretched canvas, numbered and plate signed by Bruce Eagle! Includes Certificate of Authenticity! Measures approx. 23.5" x 26.5" (image).\r\n\r\nBruce Eagle was born in Oklahoma City. He is the son of Wayne Eagle, a notable Native American artist whose work was used in advertising as well as in local museums. In his early years, Bruce spent his time sketching. During his high school and college years he won several art competitions within school. \r\n\r\nEagle ultimately moved to Los Angeles, where he began assisting with the design of movie posters for several notable movie studios. This led to Eagle being commissioned by Walt Disney Studios to work on animated films such as films as Aladdin (1992), Beauty and Beast (1991), and the 50th anniversary release of Fantasia (1990), as well as the 1991 live-action releases The Rocketeer and White Fang. Eagles artistic contributions have been made to companies that cover a vast consumer market.\r\n\r\nI have 2 available, Numbered 2698/3000 and 2701/3000.  This Painting has a List Price of $240.00 each.\r\n\r\nGREAT FOR ANY COLLECTOR OR ANYONE WHO APPRECIATES AMAZING WORK AND DETAIL.', 1, '96.00', '2013-05-09 12:34:40', '2013-05-09 12:34:40', '17.95', '', 91, 'fine-art-mary-mother-of-jesus'),
(6031, 1, 2281, 'Picard & Cie Ladies Couplet Dual Time Watch with Black Satin Band', 'Picard & Cie Ladies Couplet Dual Time Black Satin Strap/Champagne Dial\r\n\r\nCompare At $545.00\r\n\r\nWorking together in perfect synchronicity, this lovely ladies timepiece features not only one but two exquisite timezone functions that work to your benefit without sacrificing great style. A polished tonneau case acts as the perfect frame to which the beautiful guilloch detailed dial resides. For that added touch of elegance, the lower dial is made with iridescent mother-of-pearl and Breguet styles hands. A shimmering satin strap completes this signature look so that you can think about other things other than your accessories.\r\n\r\n\r\n\r\nCitizen 1L45 & 5Y20 Movements', 1, '145.00', '2013-05-09 12:38:59', '2013-05-09 12:38:59', '11.99', '', 5, 'picard-cie-ladies-couplet-dual-time-watch-with-black-satin-band'),
