(111, 34, 1, 49, 0, '2013-04-26 15:59:18', '2013-04-26 15:59:18', 1, 'Question about 26" Mens Pacific Bike - Blue', 'Hey,\r\n\r\nMy name is Shahruk and I''m from BOX''NGO (we''re working on making admin messages look more legitimate). So I noticed you''re selling a bike and dropped in your phone number. That doesn''t violate any rules or whatever but I just thought you might want to know that we opened our platform up to all sellers these past couple of days.\r\n\r\nBasically anyone can see and contact you at that number, regardless of if they''re from NYU Poly or not. If that''s fine with you then carry on :) Otherwise, just a heads up!\r\n\r\nhttp://theboxngo.com/shops/viewlisting/631'),
(121, 34, 1, 871, 1, '2013-04-26 16:03:06', '2013-05-04 16:09:55', 1, 'How''s it going?', 'Hey! My name is Shahruk and I''m from BOX''NGO (working on making admin messages look more official!). Just noticed you were listing a ton of stuff on our site.\r\n\r\nI hope everything''s been easy and straightforward so far. I''d love to hear about your listing experience on our site. Let me know if there''s anything I can help you with :)'),
(131, 34, 1, 831, 0, '2013-04-26 16:36:04', '2013-04-26 16:36:04', 1, 'Just a note on upcoming changes', 'Hey TOOHOT4GAMEZ,\r\n\r\nMy name is Shahruk and I''m from the BOX''NGO team (we''re working on more official looking admin messages). \r\n\r\nSo some of the stuff you''ve posted is adult in nature and that''s fine but not everyone wants to see adult content. However, if we limit your listings to be seen in only one category, it''s unfair to you as a seller so we''ve decided to implement a quick change in the next few days.\r\n\r\nWe''re going to ask everyone once they login if they''d like to see adult content on the site. This option can be changed in their account settings but we''re going to force everyone to respond Yes/No once they login. If a user says yes, they will see listings in the adult category and if they say no they won''t unless they click adult.\r\n\r\nWe''ll move your listings over to the adult costumes section for you so you won''t need to do anything. I wanted to message you and ask your input on this. We''re just starting out so we didn''t see certain situations coming. Let me know your thoughts on this :)\r\n\r\nThanks!'),
(161, 34, 1, 38, 1, '2013-04-28 11:18:35', '2013-04-28 15:31:29', 1, 'Hey Cofounder!', 'Look at that. You have a fellow admin badge! Isn''t that cool?'),
(171, 34, 1, 38, 1, '2013-04-28 23:21:48', '2013-05-06 09:15:00', 1, 'Question about Gold Heart Crystal Necklace ', 'adsdsadsadsadsadsadsadsadsadsa\n\nhttp://theboxngo.com/shops/viewlisting/141'),
(181, 38, 1, 41, 1, '2013-05-01 00:03:43', '2013-05-01 00:31:38', 1, 'hey', 'hey there'),
(191, 38, 1, 1121, 0, '2013-05-01 00:09:50', '2013-05-06 09:14:57', 1, 'Hello!', 'Hello!\n\nI see that you have listed your bag in the "General" section of the site. We recently created a "Clothing & Bags" section, and if you added your item to that category, I would imagine it would bring even more traffic to your listing!\n\nAlso, how are you finding your experience here so far? Is everything going okay? Feel free to ask me any questions!'),
(201, 1421, 1, 1421, 1, '2013-05-02 14:53:43', '2013-05-02 17:58:11', 1, 'Question about Darrell and Michael Waltrip', 'http://theboxngo.com/shops/viewlisting/1971'),
(211, 1911, 0, 871, 1, '2013-05-04 08:37:06', '2013-05-05 14:25:11', 1, 'Hollow Heart Earrings', 'I am trying to purchase your earrings with my debit card but it won''t go through because I don''t have a coupon code.  Can you explain to me what that means?  I am new to the site and I would love your earrings!!  Thanks'),
(221, 34, 1, 2021, 1, '2013-05-09 00:24:42', '2013-05-09 00:28:06', 1, 'Duplicates?', 'Hey Lisa, is there a reason you''re posting multiple versions of the same listings?'),
(231, 2201, 1, 2021, 1, '2013-05-14 19:10:29', '2013-05-14 19:32:02', 1, 'Hi!', 'You have some really cute items. I''ll probably buy something when I get paid, or as soon as I sell something.\r\n\r\nSister of Mercy'),
